def RevComp(Pattern):
    def reverse(x):
      return x[::-1]
    reversed = list(reverse(Pattern))
    for i,j in enumerate(reversed):
        if j == "A":
            reversed[i] = "T"
        elif j == "T":
            reversed[i] = "A"
        elif j == "G":
            reversed[i] = "C"
        elif j == "C":
            reversed[i] = "G"
        else:
            print("ERROR: INCORRECT NUCLEOTIDE SEQUENCE")
            return
    print("".join(reversed))
RevComp("")
